import React from 'react'

export default function productsmall() {
    let content=props.products.map((product,index) => {
        return (
            <div key={index}>
                <section className="content">
                    <div className="row">
                        <div className="col-3">
                            <h6>No.{product.no}</h6>
                        </div>
                        <div className="col-7">
                            <h6>{product.name}</h6>
                        </div>
                    </div>
                </section>
            </div>
        )
    })
    return (
        <div className="card">
            <div className="card-body">
                {content}
            </div>
        </div>
    )
}
